INSERT INTO `projects` (`id`, `title`, `location`, `description`, `brochure`, `map`, `logo`, `imageurl`, `aminities`, `about`, `created_at`, `updated_at`, `deleted_at`) VALUES
(5, 'ROYAL DHOLERA', 'Aakru -Cher Road,Cher,Ahmedabad', 'test 1', 'https://publuu.com/flip-book/355524/815741/page/2?embed', 'https://maps.google.com/maps?q=Royal dholera, aakru-cher road,cher, ahmedabad, 382250&t=&z=10&ie=UTF8&iwloc=&output=embed', '20240304113556.png', '20240109060944.jpg', '<p>title 1</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"\" src=\"D:\\LARAVEL\\realestate\\Realestate\\public\\templatevisitor\\img\\Amenities\" /></p>', '<p>Dholera is newly developed Smart City and will have Global recognition. Central Government of India has declared as Special Investment Region and our scheme Royal Dholera is hardly 3 km from this region. Central ABCD building is 11 km away from Royal Dholera project. More than 1000 small plots are available for middle class people who can invest the small amount in land and can become a landlord. Minimum plot size available is of 85 sq yard size and bigger plots are also available. Don\'t miss a golden opportunity to invest in Dholera area. Visit our office and talk to our business executive today.</p>', '2024-01-02 22:29:46', '2024-03-04 11:35:56', NULL),
(9, 'BALAJI UPVAN', 'Phase-2, Memar, Bagodara-Tarapur 6Lane Highway, Bagodara, Ahmedabad', 'SDSD', 'https://publuu.com/flip-book/355524/825872/page/5?embed', 'https://maps.google.com/maps?q=Balaji Upvan, Bagodara- tarapur 6lane Highway, Memar, Gujarat 382240&t=&z=10&ie=UTF8&iwloc=&output=embed', '20240304113604.png', '20240213110323.jpg', '<p>DSD</p>', '<p><strong>Balaji Upvan</strong> is one hour drive from Ahmedabad on a beautiful six line highway and is lush green scheme for those who want to make a small investment in land. This project offers plots of 100, 150, 300 and 600 square yards and also offers well constructed Villas at very reasonable price. More than 90% of plots are sold in this &nbsp;scheme. Grab a golden opportunity to book your presence in a wide project of having more than 3000 customers. You may request site visit with the company executive.</p>', '2024-01-02 22:46:20', '2024-09-02 10:47:08', NULL),
(10, 'ROYAL HERITAGE CITY', 'Sabosan - Mithivavdi Road, Sabosan, Patan', 'DSDS', 'https://publuu.com/flip-book/355524/825879/page/1?embed', 'https://maps.google.com/maps?q=Royal Heritage City, Q4J5+92, Sabosan, Gujarat 384265&t=&z=10&ie=UTF8&iwloc=&output=embed', '20240304113615.png', '20240210062921.jpg', '<p>DSDS</p>', '<p>dgsgs</p>', '2024-01-02 22:46:50', '2024-03-04 11:36:15', NULL),
